import React from "react";

const WatchContent = () => {
  return (
    <div class="container">
      {/* <video
        src="../../media/vid-1.mp4"
        class="slider"
        loop
        muted
        controls
      ></video>
      <ul>
        <li>
          <video src="../../media/vid-1.mp4"></video>
        </li>
        <li>
          <video src="../../media/vid-2.mp4"></video>
        </li>
      </ul> */}
      <video width="320" height="240" controls>
        <source src="../../media/vid-1.mp4" type="video/mp4" />
        <source src="../../media/vid-2.mp4" type="video/mp4" />
      </video>
    </div>
  );
};

export default WatchContent;
